INSERT INTO public.todos (created_at,id,is_complete,title,user_id) VALUES (DEFAULT, '5b27c026-179b-556d-aaa9-42b38c28f620', DEFAULT, 'Nohani keyuvihy chinasoha hynirae raekimemo, na kovisokai kahyra tahy shivashiyo.', NULL), (DEFAULT, '9c0761f5-476e-558a-80d1-e1dc095d8ca8', DEFAULT, 'Hyke mo yoma nicea va vakinmo mehakinkai maki.', NULL), (DEFAULT, 'd717aabd-38e0-50f2-bbdc-a6c8411afaf8', DEFAULT, 'Me kichi kihame ki yonichicea.', NULL), (DEFAULT, '25cac768-72c6-55cd-b7f4-a1de764ed824', DEFAULT, 'Kokemokin mika yokevaso mamihy rashime yuame.', NULL), (DEFAULT, 'f431610f-381e-534b-b78c-c8e53d196e8c', DEFAULT, 'Chimayo nakinmerae kin kiracea me mamo.', NULL), (DEFAULT, 'af768de8-cfb5-5c65-876e-91af1461904f', DEFAULT, 'Nomevima ka hayu kiyona maceame kin, tanimu noa vime ra ceayuvahy.', NULL), (DEFAULT, 'd36cb735-4512-5713-9527-df63793b9849', DEFAULT, 'Maso me chishi rayu komume kihachi.', NULL), (DEFAULT, 'ed428dc7-8403-53ab-9ed7-43997ed9c45b', DEFAULT, 'Mo vichicea munaki haki ko taceahy.', NULL), (DEFAULT, '529b5fde-6571-575a-ace0-f657a7c46713', DEFAULT, 'Mikai nakinvi mota mokaimo nikai so hakevi.', NULL), (DEFAULT, '301c9bd9-8f50-5f40-936f-edeac13a3af3', DEFAULT, 'Chihy hy kaki kaiyume kin.', NULL), (DEFAULT, 'c5d9296a-e225-5955-a49b-9a4219c03cc0', DEFAULT, 'Kin hamumo ha vimo hy naso.', NULL), (DEFAULT, '979fc471-08e3-5ec4-97fe-c4752380f33d', DEFAULT, 'Ki rameni sova tamuhy chiyoraso minayo kihanona.', NULL), (DEFAULT, '5e28d4cf-13a2-5116-bfa1-5cf3e928c49d', DEFAULT, 'Miceano vitakina somu shisova kiyuha, no sohy ni hyki mochicea.', NULL), (DEFAULT, '689caceb-e077-500a-9545-eab6a54eacc2', DEFAULT, 'Kaimeracea yuniyo yo kaishino rae rako kinso, yu cea kike shianohy nikai muanichi na kaiyu.', NULL), (DEFAULT, 'fa794225-44ad-5f55-afb6-8bcb93f4beba', DEFAULT, 'Vikamo na kaime mo hameva nayuchira kano ma, hake rae visovako vaki mamuhahy machima tayu shike.', NULL), (DEFAULT, '79e66388-20b1-5953-951f-52d5b723ecf7', DEFAULT, 'Kakinkokai noma mo vayota ceami chi rani viyuramo, raenishi ka keraehyshi yo viyo kai.', NULL), (DEFAULT, '472351de-9aed-575f-ae8b-4e4775ad89a4', DEFAULT, 'Memo ranima ceavivame kechime kemuko momumamu hakeko, haceanomu ra chisorani yucea kaisochishi vavichi mashi.', NULL), (DEFAULT, 'a4f14b33-1daa-58c3-abc7-4e5bd4b5effa', DEFAULT, 'Shimemi name kaiahyva chiceakinke vacea vame raekinyoki.', NULL), (DEFAULT, '88c31fec-1f6e-5639-99b3-8e7bc1fa4f75', DEFAULT, 'Keyu ki nomu cea soma na ceanoraeso kinhy.', NULL), (DEFAULT, 'facfcda9-761a-5510-8906-be89e814620e', DEFAULT, 'Kimu viyuvita keshi kairaeshino so.', NULL);
